	add("gundi", "{\"term\":\"gundi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the several rodents of the family Ctenodactylidae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Gary Laval Ranck, \u0027The Rodents of Libya: Taxonomy, Ecology and Zoogeographical Relationships\u0027, [http://books.google.com.au/books?id\u003dtEJ7AnIExEoC\u0026amp;q\u003d%22gundis%22\u0026amp;dq\u003d%22gundis%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJUvVUqWXHorQkwXwoIHIBg\u0026amp;ved\u003d0CM8BEOgBMB0 page 258\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fact that specimens were collected and observed only in the higher portions of the gebel near Rumia is a direct result of my efforts having been concentrated there and does not indicate that \u0027\u0027gundis\u0027\u0027 are most abundant at higher elevations or that they do not occur at lower elevations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027\u0027\u0027Gundi\u0027\u0027\u0027, entry in Michael A. Mares (editor), \u0027Encyclopedia of Deserts\u0027, [http://books.google.com.au/books?id\u003dg3CbqZtaF4oC\u0026amp;pg\u003dPA258\u0026amp;dq\u003d%22gundis%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJUvVUqWXHorQkwXwoIHIBg\u0026amp;ved\u003d0CFQQ6AEwB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22gundis%22\u0026amp;f\u003dfalse page 258\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Gundis\u0027\u0027 occur over most of North Africa, including the western Sahara Desert and Sahel west of 15° east longitude, from Mauritania to Libya and Chad\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, \u0027\u0027\u0027Gundis\u0027\u0027\u0027, entry in Peter Haggett (editor), \u0027Encyclopedia of World Geography\u0027, Volume 24, [http://books.google.com.au/books?id\u003dhoqVekc_XJIC\u0026amp;pg\u003dPA2220\u0026amp;dq\u003d%22gundis%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJUvVUqWXHorQkwXwoIHIBg\u0026amp;ved\u003d0CDAQ6AEwA\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22gundis%22\u0026amp;f\u003dfalse page 2220\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Small balls of soft fur scampering up vertical rock faces, trilling and chirping like flocks of birds: these are the \u0027\u0027gundis\u0027\u0027, a curious family of rock-dwelling rodents that are found only in northern Africa. Four species of \u0027\u0027gundi\u0027\u0027 live in the Sahara, one in the Horn of Africa\", \"priority\":9}]}, \"synonyms\":{}}");

