	add("gunzel", "{\"term\":\"gunzel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Believed to be a derivation of the American slang gunsel (1), meaning a gangster or hoodlum who uses a gun, popularised in books such as \u0027Wikipedia:Maltese_falcon|The Maltese Falcon\u0027. In these books the implication was that a gunsel was somewhat foolish and reckless. The word gunzel originated from the Wikipedia:Sydney_Tramway_Museum|Sydney Tramway Museum in the 1960s as a term for foolish or reckless railfans who shot at things with cameras. Usage was originally confined to south eastern states, it has since spread to the whole of Australia and parts of New Zealand. May be used to refer to a specific interest, e.g. \u0026quot;freight gunzel\u0026quot;, \u0026quot;tram gunzel\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In Australia, a railway enthusiast. Originally derogatory, referring to overly enthusiastic or foolish rail fans. Now refers to railway enthusiasts in general, and the term is often used with pride\", \"priority\":1}]}, \"synonyms\":{}}");

